catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }

   var st = g_form.getValue('u_start_dt');
	var ed = g_form.getValue('u_end_dt');

	if(ed !== ""){
		if(st > ed){
			alert("Error");
			g_form.clearValue('u_end_dt');
		}
	}

}
